import React, { Component } from "react";

export default class Bio extends Component {
  render() {
    return (
      <div className="bio-container">
        <div className="bio-header">
          <h2>About Me</h2>
        </div>
        <div className="boxed">
          <div className="bio-item">
            <p className="oneandquarter">
              Bootcamp grad and software engineer at Bloomberg LP in New York.
              I have a background in math and came to programming from
              quantitative finance. You can check out some of my projects by
              clicking the arrow below.
            </p>
          </div>
          <svg xmlns="http://www.w3.org/2000/svg" class="typography/icon:after" viewBox="0 0 16 16">
  <path d="M2.5 8H13" fill="none" vector-effect="non-scaling-stroke"></path>
  <path d="M8 3l5 5-5 5" fill="none" vector-effect="non-scaling-stroke"></path>
</svg>
        </div>
      </div>
    );
  }
}
